import axios from 'axios'


const API_URL = 'http://localhost:8000/'

class UserService {
    profile1(username,password){
        return axios
        .get(API_URL + 'profile/',
        username,
        password
        )
        // .then(response => {
        //     return response.data
        // })
    }
}


export default UserService
